import React, { Component } from 'react'
import { Row, Col } from 'antd'

class QjLevel extends Component {
    render() {
        return (
            <div className='qj-level'>

                <div className='tangle'>
                    {/* <img  /> */}
                    <span>强军阶梯</span>
                </div>
                <Row style={{ marginTop: "10px" }} >
                    <Col span={5} className="mini-tangle">
                        精品课程
                    </Col>
                    <Col span={5} offset={2} className="mini-tangle">
                        案例分析
                    </Col>
                    <Col span={10} offset={2} className="mini-tangle">
                        活动概况
                    </Col>
                </Row>
            </div>
        )
    }
}

export default QjLevel;
